This is a clean organically grown fine coffee powder that dissolves into hot water. 
(Due to high demand from people drinking this in person at events we have decided to offer this here by the bag).
SERVING
One serving is approximately 1 to 2 teaspoons. (Obviously a little less if you like it milder).
COFFEE POWDER
This is 100% coffee powder and does not contain any mushrooms. A  great way to enjoy and enhance your Reishi, Lions Mane or Chaga mushroom drink is by adding it to coffee like this.
